import { Dimensions } from 'react-native';

export const DEFAULT_WIDTH = Dimensions.get('window').width;

export const TYPES = {
  default: 'default',
  high: 'hqdefault',
  medium: 'mqdefault',
  standard: 'sddefault',
  maximum: 'maxresdefault',
};
